import BasketStore from './stores/BasketStore';

const basket = new BasketStore();

export const Context = createContext({
  basket,
});

ReactDOM.render(
  <React.StrictMode>
    <Context.Provider value={{ basket }}>
      <App />
    </Context.Provider>
  </React.StrictMode>,
  document.getElementById('root')
);
